    //     mapElement={<div style={{ height: `100%` }} />}
    //   >
    //   </Map>
    // </div>
      <Card
        statsIcon="fa fa-history"
        id="chartHours"
        title="Confirmed Cases in US"
        category={"Updated by " + dataCollectTime}
        content={
          <div id="googleMap" style={{width:"100%", height:"300px"}}>

            <Map
              center={coords}
              zoom={4}
              places={US_location}
              googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCD66iXvfQg8hp7BPTdsXxIgG1S_6EK998"
              loadingElement={<div style={{ height: `100%` }} />}
              containerElement={<div style={{ height: `200%` }} />}
              mapElement={<div style={{ height: `100%` }} />}
            >
            </Map>
          </div>
        }
      />
    );
  }
}

export default (USMap);
